import React, { Component } from "react";
import Layout from "../Layout";
import Summary from "./Summary";

export default class Checkout extends Component {
  render() {
    return (
      <Layout>
        <div>
        <Container style={styles.container}>
    <h1 style={styles.h1}>Check out</h1>
      <Row>
        <Col md='8'>
          <ListGroup flush >
            <CheckoutStepTwo 
              styles={styles} 
              stepsUnlock={stepsUnlock}
              step2={step2}
              step2Unlock={step2Unlock}
              toggle={toggle}
              onChangeFirstName={onChangeFirstName}
              onChangeLastName={onChangeLastName}
              onChangeCountry={onChangeCountry}
              onChangeCity={onChangeCity}
              onChangeProvince={onChangeProvince}
              onChangePostalCode={onChangePostalCode}
              onChangePhoneNumber={onChangePhoneNumber}
              onChangeAdress1={onChangeAdress1}
              onChangeAdress2={onChangeAdress2}
              onChangeShipppingMethod={onChangeShipppingMethod}
              email={email}
              firstName={firstName}
              lastName={lastName}
              country={country}
              city={city}
              province={province}
              postalCode={postalCode}
              phoneNumber={phoneNumber}
              address1={address1}
              address2={address2}
              shippingMethod={shippingMethod}
              formValidator={formValidator}
              formIsValid={formIsValid}
              addUserAddress={addUserAddress}
            />
            <CheckoutStepThree 
              styles={styles}
              step3={step3}
              step3Unlock={step3Unlock}
              toggle={toggle}
              getUserAddress={getUserAddress}
              onSubmitOrder={onSubmitOrder}
              selectorTotalAmountCart={selectorTotalAmountCart}
              totalDelivery={totalDelivery}
            />
          </ListGroup>
        </Col>    
        <Col md='4'>
          <CheckoutMiniSummary 
            getCart={getCart} 
            selectorTotalAmountCart={selectorTotalAmountCart}
            totalDelivery={totalDelivery}
          />
        </Col>      
      </Row>
    </Container>
        </div>
      </Layout>
    );
  }
}
